window.bookSummaryJSON = "<p>IMPORTANT UPDATE: This audio is the new recording by DJ Holte, which replaced the original inferior recording and also contains text that was added in the 2012 revised edition of Market Wizards. </p> <p>What separates the world's top traders from the vast majority of unsuccessful investors? In this iconic financial classic, Jack Schwager sets out to answer this question in his interviews with superstar money-makers including Bruce Kovner, Richard Dennis, Paul Tudor Jones, Michel Steinhardt, Ed Seykota, Marty Schwartz, Tom Baldwin, and more in this audiobook. </p> <p>This interview-style audiobook from a financial expert is a must-listen for traders and professional financiers alike, as well as anyone interested in gaining insight into how the world of finance really works. </p> <p>Filled with anecdotes about market experiences, including the story of a trader who, after wiping out several times, turned $30,000 into $80 million, and an electrical engineer from MIT whose computerized trading has earned returns of 250,000 percent over 16 years. </p> <p>One of the most insightful, best-selling trading books of all time, including 16 interviews! </p>"; 
